package Practice;

public class HarishQuiz {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		/*
		 * for(int i=1;i!=10;i+=3) { System.out.println(i); }
		 */
		int val = 10;
		do {
			val--;
			--val;

		} while (--val > 10);
		{
			System.out.println(val);
		}

	}

}
